import React,{Component} from "react";
import './Skillset_text.css';

class Skillset_text extends Component {
    render(){
        return(
            <div className="Main-Skillset_text">
                <div className="Skillset_text_heading"><h1 className="heading_here">Tech Weapons I have</h1></div>
                <div className="Skillset_text_names">
                    <button style={
                        {background : 'rgba(209,237,242,1)'}
                        }>HTML</button>
                    <button style={{
                        background:'rgba(255, 87, 51,0.2)'
                    }}>CSS</button>
                    <button style={{
                        background : 'rgba(197,180,227,0.7)'
                    }}>Bootstrap</button>
                    <button style={{
                        background : 'rgba(146,210,147,0.6)'
                    }}>Javascript</button>
                    <button style={{
                        background : 'rgba(255,127,127,0.6)'
                    }}>React JS</button>
                    <button style={{
                        background : 'rgba(63,81,181,0.6)'
                    }}>C programming</button>
                    <button style={{
                        background : 'rgba(254,216,177,1)'
                    }}>C++ programming</button>
                    <button>Wordpress</button>
                    <button>SQL language</button>
                    <button>PHP programming</button>
                    <button>R programming</button>
                    <button>Python programming</button>
                    <button>JAVA programming</button>
                    <button>Linux Basics</button>
                    <button>Cyber Security</button>
                    <button>Data Structures in C++</button>
                    <button>Trading - Equity + Future&Options</button>
                </div>
            </div>
        )
    }
}

export default Skillset_text;
